DROP TABLE IF EXISTS user_tag CASCADE;
DROP TABLE IF EXISTS tag CASCADE;
DROP TABLE IF EXISTS message_file CASCADE;
DROP TABLE IF EXISTS message CASCADE;
DROP TABLE IF EXISTS file_message CASCADE;
DROP TABLE IF EXISTS file CASCADE;
DROP TABLE IF EXISTS complaint CASCADE;
DROP TABLE IF EXISTS friendship CASCADE;
DROP TABLE IF EXISTS person CASCADE;

create table person
(
    role        integer      not null,
    avatar_id   bigint,
    id          bigserial
        primary key,
    login       varchar(30)  not null
        unique,
    email       varchar(50)  not null
        unique,
    first_name  varchar(50)  not null,
    last_name   varchar(50)  not null,
    phone       varchar(50)  not null,
    subject     varchar(50),
    description text,
    password    varchar(255) not null
);

alter table person
    owner to "user";

create table complaint
(
    closed_at      timestamp,
    complainant_id bigint
        constraint fk2mmsw4p6pahg04b3c8noqvv28
            references person,
    created_at     timestamp   not null,
    defendant_id   bigint
        constraint fkek5nq06hk5ycgcrwrb8ldx2ud
            references person,
    id             bigserial
        primary key,
    title          varchar(50) not null,
    text           text        not null
);

alter table complaint
    owner to "user";

create table file
(
    created_by bigint
        constraint fkbxnroosyw94c299skc6834xtp
            references person,
    id         bigserial
        primary key,
    name       varchar(50) not null,
    data       bytea       not null
);

alter table file
    owner to "user";

create table friendship
(
    status       integer not null,
    id           bigserial
        primary key,
    requestor_id bigint  not null
        constraint fkgcbgvg5wnsannt8s5yi3d5l85
            references person,
    responder_id bigint  not null
        constraint fk4esr8u2uucg36lg9qd5ukqetx
            references person
);

alter table friendship
    owner to "user";

create table message
(
    id             bigserial
        primary key,
    receiver_id    bigint
        constraint fkqtmfeomfyd8a8s1yugp79npmt
            references person,
    responds_to_id bigint
        constraint fkrc2xs87jtkc6lwmvsr05ys5df
            references message,
    sender_id      bigint
        constraint fk6p9dy39ram5rqdl84nciff92j
            references person,
    time           timestamp,
    text           varchar(50) not null
);

alter table message
    owner to "user";

create table file_message
(
    id bigint not null
        primary key
        constraint fki5advhfah0yt1kwpljl4fjp57
            references message
);

alter table file_message
    owner to "user";

create table message_file
(
    file_id    bigint not null
        constraint fkifrvbgtfej22p9twhgmkn676o
            references file,
    message_id bigint not null
        constraint fklxqm1hth3c6m3qf3pess87oq1
            references message
);

alter table message_file
    owner to "user";

create table tag
(
    id   bigserial
        primary key,
    name varchar(50) not null,
    type varchar(50) not null,
    unique (type, name)
);

alter table tag
    owner to "user";

create table user_tag
(
    tag_id  bigint not null
        constraint fk9qknt3y115f17660k0qnm9x3g
            references tag,
    user_id bigint not null
        constraint fk3f008pvt11ljdcfk4s3l0l6ca
            references person,
    primary key (tag_id, user_id)
);

alter table user_tag
    owner to "user";


